from pydantic import BaseModel
from typing import Union, List


class ImageIdentify(BaseModel):
    imagecontent: str

    class Config:
        schema_extra = {
            "example": {
                "imagecontent": ""
            }}


class ImageRegister(ImageIdentify):
    name: str

    class Config:
        schema_extra = {
            "example": {
                "name": "李知恩",
                "imagecontent": ""
            }}


class Image(BaseModel):
    name: str
    comment: str


class FallImage(BaseModel):
    filebase64str: str
